public SubClusterId getSubClusterId() {
  SubClusterDeregisterRequestProtoOrBuilder p = viaProto ? proto : builder;
  if (!p.hasSubClusterId()) {
    return null;
  }
  return convertFromProtoFormat(p.getSubClusterId());
}
